import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header className="fixed top-0 left-0 w-full bg-white shadow z-10 flex items-center justify-between px-6 py-3">
      <span className="font-extrabold text-lg tracking-tight">Mentor Tríade</span>
      <nav className="flex gap-4">
        <Link to="/chat" className="text-gray-700 hover:text-blue-600 font-medium">
          Chat
        </Link>
        <Link to="/sessoes" className="text-gray-700 hover:text-blue-600 font-medium">
          Sessões Anteriores
        </Link>
       


        <Link to="/politica" className="text-gray-700 hover:text-blue-600 font-medium">
          Política de Privacidade
        </Link>
        {/* Futuro: <Link to="/login" className="text-gray-700 hover:text-blue-600 font-medium">Login</Link> */}
      </nav>
    </header>
  );
}
